    <script type="text/babel">
      // Initializing React app
      const { useState, useEffect } = React;
      const { LineChart, Line, XAxis, YAxis, CartesianGrid, Tooltip, Legend, ResponsiveContainer } = Recharts;

      // Defining main App component
      const App = () => {
          const [data, setData] = useState([]);
          const [loading, setLoading] = useState(true);
          const [metrics, setMetrics] = useState({});

          // Função para carregar dados (simulada, já que o CSV está embutido)
          const loadFileData = (filename) => {
              // Aqui você deve incluir o conteúdo do arquivo SOLUSDT-1m-2025-04.csv
              // Como o arquivo é grande, assumo que está disponível localmente ou embutido
              return document.getElementById('csv-data').textContent;
          };

          // Loading and processing data
          useEffect(() => {
              const csvData = loadFileData("SOLUSDT-1m-2025-04.csv");

              // Calculating EMA
              const calculateEMA = (series, period) => {
                  const k = 2 / (period + 1);
                  let ema = [];
                  let prevEMA = series[0];
                  ema.push(prevEMA);
                  for (let i = 1; i < series.length; i++) {
                      prevEMA = (series[i] * k) + (prevEMA * (1 - k));
                      ema.push(prevEMA);
                  }
                  return ema;
              };

              // Calculating RSI
              const calculateRSI = (series, period) => {
                  let gains = [], losses = [];
                  for (let i = 1; i < series.length; i++) {
                      const delta = series[i] - series[i - 1];
                      gains.push(delta > 0 ? delta : 0);
                      losses.push(delta < 0 ? -delta : 0);
                  }
                  const avgGain = gains.slice(0, period).reduce((a, b) => a + b, 0) / period;
                  const avgLoss = losses.slice(0, period).reduce((a, b) => a + b, 0) / period;
                  let rs = avgGain / (avgLoss || 1);
                  let rsi = [100 - (100 / (1 + rs))];
                  for (let i = period; i < series.length - 1; i++) {
                      const newGain = gains[i] || 0;
                      const newLoss = losses[i] || 0;
                      const newAvgGain = ((avgGain * (period - 1)) + newGain) / period;
                      const newAvgLoss = ((avgLoss * (period - 1)) + newLoss) / period;
                      rs = newAvgGain / (newAvgLoss || 1);
                      rsi.push(100 - (100 / (1 + rs)));
                      avgGain = newAvgGain;
                      avgLoss = newAvgLoss;
                  }
                  return rsi;
              };

              // Parsing CSV data
              Papa.parse(csvData, {
                  header: true,
                  skipEmptyLines: true,
                  transform: (value, header) => {
                      let cleaned = value.trim().replace(/^"|"$/g, '').replace(',', '.');
                      return header === 'timestamp' ? parseInt(cleaned) : parseFloat(cleaned) || cleaned;
                  },
                  complete: (results) => {
                      const df = results.data;
                      const closes = df.map(row => row['close']).filter(v => !isNaN(v));
                      const timestamps = df.map(row => row['timestamp']).filter((_, i) => !isNaN(closes[i]));

                      // Calculating indicators
                      const ema15 = calculateEMA(closes, 15);
                      const ema20 = calculateEMA(closes, 20);
                      const rsi7 = calculateRSI(closes, 7);

                      // Running backtest
                      let capital = 100.0;
                      let position = 0;
                      let entryPrice = 0;
                      let size = 0;
                      const trades = [];
                      const equity = [];

                      for (let i = Math.max(20, 7); i < closes.length; i++) {
                          equity.push({
                              timestamp: new Date(timestamps[i] / 1000),
                              equity: capital
                          });

                          if (position === 0 && i < ema15.length && i < rsi7.length) {
                              if (ema15[i] > ema20[i] && rsi7[i - 7] < 25) {
                                  position = 1;
                                  entryPrice = closes[i];
                                  size = capital / entryPrice;
                                  trades.push({
                                      entry_time: timestamps[i],
                                      entry_price: entryPrice,
                                      size: size,
                                      type: 'buy'
                                  });
                              }
                          } else if (position === 1) {
                              const currentPrice = closes[i];
                              if (currentPrice <= entryPrice * (1 - 0.005)) {
                                  capital = size * currentPrice;
                                  trades.push({
                                      exit_time: timestamps[i],
                                      exit_price: currentPrice,
                                      profit: (currentPrice - entryPrice) * size,
                                      type: 'sell (stop-loss)'
                                  });
                                  position = 0;
                              } else if (currentPrice >= entryPrice * (1 + 0.01)) {
                                  capital = size * currentPrice;
                                  trades.push({
                                      exit_time: timestamps[i],
                                      exit_price: currentPrice,
                                      profit: (currentPrice - entryPrice) * size,
                                      type: 'sell (take-profit)'
                                  });
                                  position = 0;
                              } else if (ema20[i] > ema15[i]) {
                                  capital = size * currentPrice;
                                  trades.push({
                                      exit_time: timestamps[i],
                                      exit_price: currentPrice,
                                      profit: (currentPrice - entryPrice) * size,
                                      type: 'sell (ema cross)'
                                  });
                                  position = 0;
                              }
                          }
                      }

                      // Final equity point
                      equity.push({
                          timestamp: new Date(timestamps[timestamps.length - 1] / 1000),
                          equity: capital
                      });

                      // Calculating metrics
                      const totalTrades = trades.filter(t => t.type.startsWith('sell')).length;
                      const winningTrades = trades.filter(t => t.type.startsWith('sell') && t.profit > 0).length;
                      const winRate = totalTrades > 0 ? (winningTrades / totalTrades * 100).toFixed(2) : '0.00';
                      const finalCapital = capital.toFixed(2);
                      const profit = (capital - 100).toFixed(2);
                      const profitPct = ((capital - 100) / 100 * 100).toFixed(2);
                      const equityValues = equity.map(e => e.equity);
                      const peak = Math.max(...equityValues);
                      const drawdowns = equityValues.map((e, i) => (Math.max(...equityValues.slice(0, i + 1)) - e) / Math.max(...equityValues.slice(0, i + 1)) * 100);
                      const maxDrawdown = Math.max(...drawdowns).toFixed(2);

                      setMetrics({
                          initial_capital: 100,
                          final_capital: finalCapital,
                          profit: profit,
                          profit_pct: profitPct,
                          total_trades: totalTrades,
                          win_rate: winRate,
                          max_drawdown: maxDrawdown
                      });

                      setData(equity.map(e => ({
                          timestamp: e.timestamp.toISOString(),
                          equity: parseFloat(e.equity.toFixed(2))
                      })));
                      setLoading(false);
                  },
                  error: (err) => console.error(err)
              });
          }, []);

          // Rendering loading state
          if (loading) {
              return <div className="text-center p-4">Loading...</div>;
          }

          // Formatting tooltip for chart
          const formatTooltip = (value, name) => {
              return [`${value.toFixed(2)}`, name];
          };

          // Formatting X-axis tick
          const formatXAxis = (tick) => {
              const date = new Date(tick);
              return `${date.getDate()}/${date.getMonth() + 1}`;
          };

          // Rendering main report
          return (
              <div className="container mx-auto p-4">
                  <h1 className="text-2xl font-bold mb-4">SOL/USDT Backtest Report</h1>

                  {/* Displaying summary */}
                  <div className="bg-white p-4 rounded shadow mb-4">
                      <h2 className="text-xl font-semibold">Summary</h2>
                      <p>Initial Capital: ${metrics.initial_capital}</p>
                      <p>Final Capital: ${metrics.final_capital}</p>
                      <p>Profit/Loss: ${metrics.profit} ({metrics.profit_pct}%)</p>
                      <p>Total Trades: {metrics.total_trades}</p>
                      <p>Win Rate: {metrics.win_rate}%</p>
                      <p>Max Drawdown: {metrics.max_drawdown}%</p>
                  </div>

                  {/* Rendering equity curve */}
                  <div className="bg-white p-4 rounded shadow">
                      <h2 className="text-xl font-semibold mb-2">Equity Curve</h2>
                      <ResponsiveContainer width="100%" height={400}>
                          <LineChart data={data}>
                              <CartesianGrid strokeDasharray="3 3" />
                              <XAxis dataKey="timestamp" tickFormatter={formatXAxis} />
                              <YAxis label={{ value: 'Equity ($)', angle: -90, position: 'insideLeft' }} fontSize={12} />
                              <Tooltip formatter={formatTooltip} labelFormatter={(label) => new Date(label).toLocaleString()} />
                              <Legend />
                              <Line type="monotone" dataKey="equity" stroke="#8884d8" name="Equity" />
                          </LineChart>
                      </ResponsiveContainer>
                  </div>

                  {/* Highlighting interesting fact */}
                  <div className="bg-white p-4 rounded shadow mt-4">
                      <h2 className="text-xl font-semibold">Interesting Fact</h2>
                      <p>
                          The strategy's reliance on RSI < 25 for entries suggests it targets oversold conditions, but the low frequency of such conditions in a 1-minute timeframe may limit trading opportunities, as observed in the low number of total trades.
                      </p>
                  </div>
              </div>
          );
      };

      // Rendering the app
      const root = ReactDOM.createRoot(document.getElementById('root'));
      root.render(<App />);
    </script>
